import React from 'react'

export default function Navbar() {
  return (
    <nav className='navbar fixed w-full'>
        <div className='w-[80%] my-0 mx-auto flex items-center justify-between'>
            <p className='w-[20%] text-[30px] '>
                Portfolio Aur√©lien Peria
            </p>
            <div className='flex items-center justify-evenly w-[60%] text-[20px]'>
                <li onMouseEnter={(e)=>{
                  e.target.style.transform="scale(1.5,1.5)"
                }} className='list-none hover:cursor-pointer transition-transform duration-150 ease-in'>Projet</li>
                <li className='list-none hover:cursor-pointer'>Skills</li>
                <li className='list-none hover:cursor-pointer'>About</li>
                <li className='list-none hover:cursor-pointer'>Contact</li>
            </div>
        </div>
    </nav>
  )
}
